class Solution {
    public static char findTheDifference(String s, String t) {
        
        char[] ss = s.toCharArray();
        char[] tt = t.toCharArray();
        char[] alphabetic = {'a','b','c','d','e','f','g','h','i','j','k','l','m','n','o','p','q','r','s','t','u','v','w','x','y','z'};
        int[] alphaNumb = new int[26];

        for(int i =0; i<tt.length; i++){
            for(int j=0; j<alphabetic.length; j++){
                if(tt[i] == alphabetic[j]){
                    alphaNumb[j]+=1;
                }
            }
        }


        for(int i=0; i<ss.length; i++){
            for(int j=0; j<alphabetic.length; j++){
                if(ss[i] == alphabetic[j] && alphaNumb[j] > 0){
                    alphaNumb[j]-=1;}
                // }else{
                //     return alphabetic[j];
                // }
            }
        }




       for(int i=0; i<alphaNumb.length; i++){
        if(alphaNumb[i] ==1){
            return alphabetic[i];
        }
       }
       return 0;
    }
 

    public static void main(String args[]){

    System.out.println(findTheDifference("", ""));

        // System.out.println(findTheDifference("abcd", "abcde"));

    }
}